import * as React from "react";
import gql from "graphql-tag";
import * as EmailValidator from 'email-validator';
import { useQuery, useMutation, useLazyQuery, useApolloClient } from "@apollo/react-hooks";

//
// GraphQL
//

const SEND_COMPANY_INVITE_VIA_EMAIL = gql`
  mutation sendCompanyInviteViaEmail($CompanyId: ID!, $EmailList:[EmailListItemInput]!) {
    sendCompanyInviteViaEmail(CompanyId:$CompanyId, EmailList:$EmailList)
  }
`;

// Style
import './GutterInviteUser.styl'; 
// Icons
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { 
    faArrowRight
} from '@fortawesome/free-solid-svg-icons';

//
// Types
//

type GutterInviteUserProps = {
  toggleGutter
  toggleMenu
  toggleGutterLoader
}

//
// Function
//

const GutterInviteUser: React.FunctionComponent<GutterInviteUserProps> = (props:any) => {
  // Set States
  const [inviteUser, setInviteUser] = React.useState({
    single:true,
    textarea:'',
    input:''
  });
  // GraphQL - M's
  const [ submitInvites, { loading:loading, error:error }] = useMutation(SEND_COMPANY_INVITE_VIA_EMAIL);

  //
  // Use Effect
  //

  React.useEffect(() => {

  });

  //
  // OnChange
  //

  const onChange = (event) => {
    let newData = {...inviteUser}; 
    newData[event.target.name] = event.target.value; 
    setInviteUser(newData);
  }

  //
  // Submit Invite User
  //

  const submitInviteUser = async () => {
    // Local 
    var emailError = false;
    const inviteArray = [];
    // Prevent
    event.preventDefault();
    props.toggleGutterLoader(true,'loading','Preping Invites','Please wait');
    if(inviteUser.single) {
      if(!EmailValidator.validate(inviteUser.input)) {
        emailError = true;
        return false;        
      }
      inviteArray.push({'email':inviteUser.input});
    } else {
      const split = inviteUser.textarea.split(',');
      split.map((value, index) => {
        if(!EmailValidator.validate(value.replace(/\s/g,''))) {
          emailError = true;
        } else {
          inviteArray.push({email:value.replace(/\s/g,'')});
        }
      }); 
      // Check Error 
      if(emailError) {
        props.toggleGutterLoader(true, 'error', 'Error', 'Incorrect Email Entered');
        const timer = setTimeout(() => {
          props.toggleGutterLoader(false, 'error', 'Error', 'Incorrect Email Entered');
        }, 4000);
        return () => {
          clearTimeout(timer);
          return false;
        }
      }
    }
    try {
      const res = await submitInvites({
        variables: {
          CompanyId:'5ddd3993dae01149faf416ff',
          EmailList:inviteArray
        }
      });
      if(res && res.data.sendCompanyInviteViaEmail) {
        setInviteUser({...inviteUser, input:'', textarea:''});
        if(await res.data.sendCompanyInviteViaEmail) {
          props.toggleGutterLoader(true,'success','Good Stuff','Invites Sent');
          const timer = setTimeout(() => {
              props.toggleGutterLoader(false,'success','Good Stuff','Invites Sent');
              props.toggleGutter('','one-active');
          }, 4000);
          return () => clearTimeout(timer);
        }
      }
    } catch(err) {
      props.toggleGutterLoader(true, 'error', 'Error', err);
      const timer = setTimeout(() => {
        props.toggleGutterLoader(false, 'error', 'Error', err);
      }, 4000);
      return () => clearTimeout(timer);
    }
  }

  //
  // Return
  //

  return (
    <div className="gutter-invite-user">
      <div className="user-header">
          <h1>Invite User</h1>
          <div className="header-back-button" onClick={(event) => props.toggleGutter('','one-active')}><FontAwesomeIcon icon={faArrowRight}/></div>
      </div>
      <form onSubmit={submitInviteUser}>
        <div className="form-label">Invite One or Multiple</div>
        <div className="form-select">
          <div className={ inviteUser.single ? 'select-button select-button-active':'select-button'}  onClick={(event) => setInviteUser({...inviteUser,['single']:true})}>Single</div>
          <div className={ !inviteUser.single ? 'select-button select-button-active':'select-button'}  onClick={(event) => setInviteUser({...inviteUser,['single']:false})}>Multiple</div>
        </div>
        {/** Single */}
        { inviteUser.single &&
          <>
            <div className="form-label">Email Address</div>
            <input type="text" onChange={(event) => onChange(event)} name="input" placeholder="Email Address" value={inviteUser.input || ""}/>
            <div className="form-footnote">Please separate multiple addresses with commas.</div>
          </>  
        }
        {/** Multiple */}
        { !inviteUser.single &&
          <>
            <div className="form-label">Multiple Email Addresses</div>
            <textarea onChange={(event) => onChange(event)}  name="textarea" placeholder="Multiple Email Addresses..." value={inviteUser.textarea || ""}></textarea>
            <div className="form-footnote">Please separate multiple addresses with commas.</div>
          </>
        }
        <button>Send {inviteUser.single && <>Invite</>}{!inviteUser.single && <>Invites</>}</button>
      </form>
    </div>
  );
};

export default GutterInviteUser
